create table assets (
	asset_tag VARCHAR(50),
	tag_number VARCHAR(50),
	brand  VARCHAR(14),
	serial_number VARCHAR(50),
	type_os_type VARCHAR(10),
	processor VARCHAR(13),
	type_of_hard_disk VARCHAR(3),
	size_of_disk VARCHAR(6),
	`memory` VARCHAR(5),
	office_version VARCHAR(21),
	license VARCHAR(50),
	ip_address VARCHAR(50),
	section VARCHAR(24),
	type_of_user VARCHAR(23),
	`user` VARCHAR(50),
	email_address VARCHAR(50),
	email_address_pass VARCHAR(50),
	`date_purchased` DATE,
	ups VARCHAR(3),
	recovery_type VARCHAR(19),
	unit_type VARCHAR(7),
	time_stamp DATE
);

